				var iMediumH = parseInt(oVMLDiv.getAttribute("mediumh"), 10);
				var iLargeH = parseInt(oVMLDiv.getAttribute("largeh"), 10);
				if(isNaN(iSmallH)) iSmallH = 11;
				if(isNaN(iMediumH)) iMediumH = 15;
				if(isNaN(iLargeH)) iLargeH = 17;
